import React, { useState, useEffect } from "react";
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";

const PPICProd = () => {
  const [isDelet, setIsDelet] = useState(false);
  const [isWip, setIsWip] = useState(false);
  const [isWeek2, setIsWeek2] = useState(false);
  const [isModelW1, setIsModelW1] = useState(false);
  const [InputModel, setInputModel] = useState(false);
  const [Model, setModel] = useState("");
  const [Pnc, setPnc] = useState("");
  const [Week, setWeek] = useState("");
  const [Stock, setStock] = useState("");
  const [SE, setSE] = useState("");
  const [date, setDate] = useState("");
  const [Wip, setWip] = useState("");
  const [QC, setQC] = useState("");
  const [NewModel, setNewModel] = useState("");
  const [NewPnc, setNewPnc] = useState("");
  const [data, setData] = useState([]);
  const [filteredData, setFilteredData] = useState([]);
  const [datanewmodel, setDatanewmodel] = useState([]);
  const [selectedItem, setSelectedItem] = useState(null);
  const [selectedItemWip, setSelectedItemWip] = useState(null);
  const [initialWip, setinitialWip] = useState(0);

  // PDF
  const exportToPDF = () => {
    const doc = new jsPDF();
    const table = document.getElementById("data-table");

    // Menambahkan tema "plain"

    doc.autoTable({ html: table, theme: "grid" });
    doc.save("PPIC.pdf");
  };

  //-----

  // GET NEW MODEL

  useEffect(() => {
    fetch("http://192.168.101.236:3001/api/get/newmodel")
      .then((response) => response.json())
      .then((data) => {
        setDatanewmodel(data);
      })
      .catch((error) => {
        // Tangani error jika permintaan gagal
        console.error("Error fetching data:", error);
      });
  }, []);

  // ----

  // GET DATA BERDASARKAN DATE

  const handleDateChange = (e) => {
    const inputDateTime = e.target.value;
    const formattedDateTime = inputDateTime.replace(
      /(\d{2})\/(\d{2})\/(\d{4})\s(\d{2}):(\d{2})/,
      "$3-$2-$1 $4:$5:00"
    );
    setDate(formattedDateTime);
  };

  useEffect(() => {
    fetch("http://192.168.101.236:3001/api/get/Week1")
      .then((response) => response.json())
      .then((json) => {
        // mengubah properti timestamp menjadi tanggal dan Date
        json.forEach((item) => {
          const date = new Date(item.Date);
          const day = date.getDate();
          const month = date.getMonth() + 1;
          const year = date.getFullYear();
          const hours = date.getHours();
          const minutes = date.getMinutes();
          const formattedDate = `${day.toString().padStart(2, "0")}-${month
            .toString()
            .padStart(2, "0")}-${year} / ${hours
            .toString()
            .padStart(2, "0")}:${minutes.toString().padStart(2, "0")}`;
          item.Date = formattedDate;
        });
        json.sort((a, b) => Date.parse(a.Date) - Date.parse(b.Date));
        json.reverse();
        setData(json);
        setFilteredData(json);
      });
  }, []);
  //----------

  // Submit PPIC / ADD
  const SubmitPPIC = (event) => {
    if (!Model || !Pnc || !Week || !date || !Stock) {
      alert("Harap isi semua kolom!");
      return;
    }

    const data = {
      Model: Model,
      Pnc: Pnc,
      Week: Week,
      Stock: Stock,
      Wip: Wip,
      date: date,
      SE: SE,
      QC: QC,
    };

    fetch(`http://192.168.101.236:3001/api/post/Week1`, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(data),
    })
      .then((response) => {
        if (response.status === 200) {
          alert("Data Berhasil Di Input");
          setIsModelW1(false);
          window.location.reload();
          event.preventDefault();
        } else {
          throw new Error("Error adding data");
        }
      })
      .catch((err) => {
        console.log(err);
      });
  };

  useEffect(() => {
    if (Stock !== "" && Week !== "") {
      const SEValue = parseInt(Stock) - parseInt(Week);
      setSE(SEValue.toString());
    } else {
      setSE("");
    }
  }, [Week, Stock]);
  //----------

  // BUTTON DELET
  const handleDelete = () => {
    if (selectedItem) {
      // Kirim permintaan ke backend untuk menghapus data dengan ID selectedItem
      fetch(`http://192.168.101.236:3001/api/delete/${selectedItem}`, {
        method: "DELETE",
      })
        .then((response) => response.json())
        .then((result) => {
          alert("Data Berhasil Di Hapus");
          window.location.reload();
          setSelectedItem(null);
        })
        .catch((error) => {
          console.error("Error deleting data:", error);
        });
    }
  };
  //----------

  // UPDATE WIP PPIC
  const UpdatePPIC = (event) => {
    const data = {
      Wip: parseInt(Wip),
    };
    fetch(
      `http://192.168.101.236:3001/api/put/Week1PPIC/${selectedItemWip.No}`,
      {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(data),
      }
    )
      .then((response) => {
        if (response.status === 200) {
          alert("Rt");
          window.location.reload();
          event.preventDefault();
        } else {
          throw new Error("Error updating data");
        }
      })
      .catch((err) => {
        console.log(err);
      });
  };

  useEffect(() => {
    if (selectedItem) {
      setinitialWip(selectedItemWip.Wip);
      setWip(selectedItemWip.Wip);
    }
  }, [selectedItemWip]);

  useEffect(() => {
    // Mengupdate nilai Wip dengan menambahkan nilai Wip
    const newWip = initialWip + parseInt(Wip);
    setWip(newWip);
  }, [initialWip, Wip]);
  //----------

  // NEW MODEL / PNC
  const SubmitNew = (event) => {
    const data = {
      NewModel: NewModel,
      NewPnc: NewPnc,
    };

    fetch(`http://192.168.101.236:3001/api/post/newmodel`, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(data),
    })
      .then((response) => {
        if (response.status === 200) {
          alert("Data Berhasil Di Input");
          setIsModelW1(false);
          window.location.reload();
          event.preventDefault();
        } else {
          throw new Error("Error adding data");
        }
      })
      .catch((err) => {
        console.log(err);
      });
  };
  const uniqueModels = Array.from(
    new Set(datanewmodel.map((item) => item.Model))
  );
  //--------

  return (
    <body
      className="h-full w-full"
      style={{
        height: "200vh",
        background: "linear-gradient(90deg, #005A5B 50%, #007369 50%)",
